 We first simplify $\sqrt{1,\!000,\!000}$.  This is the square root of the given large number, 1,\!000,\!000.  Simplifying, we see that this is 1000.  Hence,  $$\sqrt{1,\!000,\!000} - \sqrt[3]{1,\!000,\!000} = 1000 - \sqrt[3]{1,\!000,\!000}.$$But then we note that $\sqrt[3]{1,\!000,\!000} = \sqrt[3]{1000 \cdot 10,\!000} = \sqrt[3]{10,\!000 \cdot 100,\!000} = 10000 \sqrt[3]{10}.$  Hence \begin{align*}
1000 - \sqrt[3]{1,\!000,\!000} &= 1000 - 10000 \sqrt[3]{10} \\
&= \boxed{-9000 \sqrt[3]{10}}.
\end{align*}
